%[text]  Experiment 2: Sampling, Reconstruction, and Low-Pass Filtering

clear all;
close all;
clc;

% Signal parameters
tot = 1;
td = 0.002;
t = 0:td:tot;
x = sin(2*pi*t) - sin(6*pi*t);

% Sampling
ts = 0.02;
Nfactor = round(ts/td);
xsm = downsample(x, Nfactor);      % Downsample (sample the signal)
xsmu = upsample(xsm, Nfactor);     % Upsample (insert zeros for reconstruction)

% Frequency axis for plotting
Lffu = 2^nextpow2(length(xsmu));
fmaxu = 1/(2*td);
Faxisu = linspace(-fmaxu, fmaxu, Lffu);

% Spectrum of upsampled signal
xfftu = fftshift(fft(xsmu, Lffu));
figure(1); %[output:5ae7abb4]
plot(Faxisu, abs(xfftu)); %[output:5ae7abb4]
xlabel('Frequency'); %[output:5ae7abb4]
ylabel('Amplitude'); %[output:5ae7abb4]
title('Spectrum of Sampled Signal'); %[output:5ae7abb4]
grid; %[output:5ae7abb4]

% Design a Low-Pass Filter (LPF)
BW = 10; % Bandwidth
H_lpf = zeros(1, Lffu);
H_lpf(Lffu/2-BW:Lffu/2+BW-1) = 1;
figure(2); %[output:0726c231]
plot(Faxisu, H_lpf); %[output:0726c231]
xlabel('Frequency'); %[output:0726c231]
ylabel('Amplitude'); %[output:0726c231]
title('Transfer function of LPF'); %[output:0726c231]
grid; %[output:0726c231]

% Apply LPF to the spectrum
x_recv = Nfactor * (xfftu) .* H_lpf;
figure(3) %[output:8d914483]
plot(Faxisu, abs(x_recv)); %[output:8d914483]
xlabel('Frequency'); %[output:8d914483]
ylabel('Amplitude'); %[output:8d914483]
title('Spectrum of LPF Output'); %[output:8d914483]
grid; %[output:8d914483]

% Reconstruct the signal in time domain
x_recv1 = real(ifft(fftshift(x_recv)));
x_recv2 = x_recv1(1:length(t));

% Compare original and reconstructed signals
figure(4) %[output:274c46a5]
plot(t, x, 'r', t, x_recv2, 'b--', 'LineWidth', 2); %[output:274c46a5]
xlabel('Time'); %[output:274c46a5]
ylabel('Amplitude'); %[output:274c46a5]
title('Original vs. Reconstructed Signal'); %[output:274c46a5]
grid; %[output:274c46a5]

